package com.app.model;

public class Head {
private int userid;
private String name;
private String email;
private String password;
private String phone;
private String deptid;
private String role;

public Head() {
	super();
	// TODO Auto-generated constructor stub
}



public Head(int userid, String name, String email, String password, String phone, String deptid, String role) {
	super();
	this.userid = userid;
	this.name = name;
	this.email = email;
	this.password = password;
	this.phone = phone;
	this.deptid = deptid;
	this.role = role;
}





public Head(String name, String email, String password, String phone, String role) {
	super();
	this.name = name;
	this.email = email;
	this.password = password;
	this.phone = phone;
	this.role = role;
}




public Head(String name, String email, String phone, String deptid) {
	super();
	this.name = name;
	this.email = email;
	this.phone = phone;
	this.deptid = deptid;
}




public Head(int userid, String name, String email, String phone) {
	super();
	this.userid = userid;
	this.name = name;
	this.email = email;
	this.phone = phone;
}



public int getUserid() {
	return userid;
}



public void setUserid(int userid) {
	this.userid = userid;
}



public String getName() {
	return name;
}



public void setName(String name) {
	this.name = name;
}



public String getEmail() {
	return email;
}



public void setEmail(String email) {
	this.email = email;
}



public String getPassword() {
	return password;
}



public void setPassword(String password) {
	this.password = password;
}



public String getPhone() {
	return phone;
}



public void setPhone(String phone) {
	this.phone = phone;
}



public String getDeptid() {
	return deptid;
}



public void setDeptid(String deptid) {
	this.deptid = deptid;
}



public String getRole() {
	return role;
}



public void setRole(String role) {
	this.role = role;
}



@Override
public String toString() {
	return "Head [userid=" + userid + ", name=" + name + ", email=" + email + ", password=" + password + ", phone="
			+ phone + ", deptid=" + deptid + ", role=" + role + "]";
}





}
